    "body": "Bumps [dot-prop](https://github.com/sindresorhus/dot-prop) from 5.1.0 to 5.3.0. **This update includes security fixes.**\n<details>\n<summary>Vulnerabilities fixed</summary>\n<p><em>Sourced from <a href=\"https://github.com/advisories/GHSA-ff7x-qrg7-qggm\">The GitHub Security Advisory Database</a>.</em></p>\n<blockquote>\n<p><strong>Prototype Pollution in dot-prop</strong>\nPrototype pollution vulnerability in dot-prop npm package before versions 4.2.1 and 5.1.1 allows an attacker to add arbitrary properties to JavaScript language constructs such as objects.</p>\n<p>Affected versions: &gt;= 5.0.0 &lt; 5.1.1</p>\n</blockquote>\n<p><em>Sourced from <a href=\"https://github.com/advisories/GHSA-ff7x-qrg7-qggm\">The GitHub Security Advisory Database</a>.</em></p>\n<blockquote>\n<p><strong>Prototype Pollution in dot-prop</strong>\nPrototype pollution vulnerability in dot-prop npm package version 5.1.0 and earlier allows an attacker to add arbitrary properties to JavaScript language constructs such as objects.</p>\n<p>Affected versions: &lt; 5.1.1</p>\n</blockquote>\n</details>\n<details>\n<summary>Release notes</summary>\n<p><em>Sourced from <a href=\"https://github.com/sindresorhus/dot-prop/releases\">dot-prop's releases</a>.</em></p>\n<blockquote>\n<h2>v5.3.0</h2>\n<ul>\n<li>Make <code>.delete()</code> return a boolean (<a href=\"https://github-redirect.dependabot.com/sindresorhus/dot-prop/issues/66\">#66</a>)  24916ff</li>\n</ul>\n<p><a href=\"https://github.com/sindresorhus/dot-prop/compare/v5.2.0...v5.3.0\">https://github.com/sindresorhus/dot-prop/compare/v5.2.0...v5.3.0</a></p>\n<h2>v5.2.0</h2>\n<ul>\n<li>Allow specifying <code>undefined</code> as the object for <code>.get()</code> and <code>.has()</code> (<a href=\"https://github-redirect.dependabot.com/sindresorhus/dot-prop/issues/58\">#58</a>)  a6be343</li>\n</ul>\n<p><a href=\"https://github.com/sindresorhus/dot-prop/compare/v5.1.1...v5.2.0\">https://github.com/sindresorhus/dot-prop/compare/v5.1.1...v5.2.0</a></p>\n<h2>v5.1.1</h2>\n<ul>\n<li>Prevent setting/getting some problematic path components  3039c8c</li>\n<li>TypeScript - Fix return type for undefined defaultValue (<a href=\"https://github-redirect.dependabot.com/sindresorhus/dot-prop/issues/56\">#56</a>)  e0f8abf</li>\n</ul>\n<p><a href=\"https://github.com/sindresorhus/dot-prop/compare/v5.1.0...v5.1.1\">https://github.com/sindresorhus/dot-prop/compare/v5.1.0...v5.1.1</a></p>\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/sindresorhus/dot-prop/commit/614e74abdfb49d59637155e77ea651af8f7988e3\"><code>614e74a</code></a> 5.3.0</li>\n<li><a href=\"https://github.com/sindresorhus/dot-prop/commit/24916ff494d84ce3af1cf5a62cd8c9b37507e492\"><code>24916ff</code></a> Make <code>.delete()</code> return a boolean (<a href=\"https://github-redirect.dependabot.com/sindresorhus/dot-prop/issues/66\">#66</a>)</li>\n<li><a href=\"https://github.com/sindresorhus/dot-prop/commit/be84f79106376a40bdec9fde61e8b3c4d96128bc\"><code>be84f79</code></a> Simplify unit tests (<a href=\"https://github-redirect.dependabot.com/sindresorhus/dot-prop/issues/67\">#67</a>)</li>\n<li><a href=\"https://github.com/sindresorhus/dot-prop/commit/282e984eed35b62321966f21b8db96ab70221ebc\"><code>282e984</code></a> 5.2.0</li>\n<li><a href=\"https://github.com/sindresorhus/dot-prop/commit/4801a63f36dedf5c525d9203d0bbc9ad44d6bb3c\"><code>4801a63</code></a> Meta tweaks</li>\n<li><a href=\"https://github.com/sindresorhus/dot-prop/commit/a6be3439d1e63923fe378465141ce56f40fc198f\"><code>a6be343</code></a> Allow specifying <code>undefined</code> as the object for <code>.get()</code> and <code>.has()</code> (<a href=\"https://github-redirect.dependabot.com/sindresorhus/dot-prop/issues/58\">#58</a>)</li>\n<li><a href=\"https://github.com/sindresorhus/dot-prop/commit/0efd03e2bffa6da4ebd69a3e5d43d6656b9b518e\"><code>0efd03e</code></a> 5.1.1</li>\n<li><a href=\"https://github.com/sindresorhus/dot-prop/commit/3039c8c07f6fdaa8b595ec869ae0895686a7a0f2\"><code>3039c8c</code></a> Prevent setting/getting some problematic path components</li>\n<li><a href=\"https://github.com/sindresorhus/dot-prop/commit/e0f8abf71164321caf1b20109000b08be506f227\"><code>e0f8abf</code></a> TypeScript - Fix return type for undefined defaultValue (<a href=\"https://github-redirect.dependabot.com/sindresorhus/dot-prop/issues/56\">#56</a>)</li>\n<li>See full diff in <a href=\"https://github.com/sindresorhus/dot-prop/compare/v5.1.0...v5.3.0\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://api.dependabot.com/badges/compatibility_score?dependency-name=dot-prop&package-manager=npm_and_yarn&previous-version=5.1.0&new-version=5.3.0)](https://dependabot.com/compatibility-score/?dependency-name=dot-prop&package-manager=npm_and_yarn&previous-version=5.1.0&new-version=5.3.0)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\nIf all status checks pass Dependabot will automatically merge this pull request.\n\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot badge me` will comment on this PR with code to add a \"Dependabot enabled\" badge to your readme\n\nAdditionally, you can set the following in the `.dependabot/config.yml` file in this repo:\n- Update frequency\n- Automerge options (never/patch/minor, and dev/runtime dependencies)\n- Out-of-range updates (receive only lockfile updates, if desired)\n- Security updates (receive only security updates, if desired)\n\n\n\n</details>",
