    "body": "Bumps [aws-sdk](https://github.com/aws/aws-sdk-js) from 2.743.0 to 2.747.0.\n<details>\n<summary>Release notes</summary>\n<p><em>Sourced from <a href=\"https://github.com/aws/aws-sdk-js/releases\">aws-sdk's releases</a>.</em></p>\n<blockquote>\n<h2>Release v2.747.0</h2>\n<p>See <a href=\"https://github.com/aws/aws-sdk-js/blob/master/CHANGELOG.md\">changelog</a> for more information.</p>\n<h2>Release v2.746.0</h2>\n<p>See <a href=\"https://github.com/aws/aws-sdk-js/blob/master/CHANGELOG.md\">changelog</a> for more information.</p>\n<h2>Release v2.745.0</h2>\n<p>See <a href=\"https://github.com/aws/aws-sdk-js/blob/master/CHANGELOG.md\">changelog</a> for more information.</p>\n<h2>Release v2.744.0</h2>\n<p>See <a href=\"https://github.com/aws/aws-sdk-js/blob/master/CHANGELOG.md\">changelog</a> for more information.</p>\n</blockquote>\n</details>\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/aws/aws-sdk-js/blob/master/CHANGELOG.md\">aws-sdk's changelog</a>.</em></p>\n<blockquote>\n<h2>2.747.0</h2>\n<ul>\n<li>feature: WorkSpaces: Adding support for Microsoft Office 2016 and Microsoft Office 2019 in BYOL Images</li>\n<li>feature: XRay: Enhancing CreateGroup, UpdateGroup, GetGroup and GetGroups APIs to support configuring X-Ray Insights</li>\n</ul>\n<h2>2.746.0</h2>\n<ul>\n<li>bugfix: Types: Re-export ConfigBase on previous config typings</li>\n<li>feature: GuardDuty: GuardDuty findings triggered by failed events now include the error code name within the AwsApiCallAction section.</li>\n<li>feature: Kendra: Amazon Kendra now returns confidence scores for both 'answer' and 'question and answer' query responses.</li>\n<li>feature: MediaPackage: Enables inserting a UTCTiming XML tag in the output manifest of a DASH endpoint which a media player will use to help with time synchronization.</li>\n<li>feature: StepFunctions: This release of the AWS Step Functions SDK introduces support for payloads up to 256KB for Standard and Express workflows</li>\n</ul>\n<h2>2.745.0</h2>\n<ul>\n<li>bugfix: XML: Fixed an array equality bug in the Node.js XML parser</li>\n<li>feature: EC2: This release adds a new transit gateway attachment state and resource type.</li>\n<li>feature: Macie2: This release of the Amazon Macie API introduces additional statistics for the size and count of Amazon S3 objects that Macie can analyze as part of a classification job.</li>\n</ul>\n<h2>2.744.0</h2>\n<ul>\n<li>feature: CodeGuruReviewer: Add support for repository analysis based code reviews</li>\n<li>feature: SecurityHub: Added a PatchSummary object for security findings. The PatchSummary object provides details about the patch compliance status of an instance.</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/aws/aws-sdk-js/commit/c706c8ea2bd2a3ab192bd511770924bc67039f66\"><code>c706c8e</code></a> Updates SDK to v2.747.0</li>\n<li><a href=\"https://github.com/aws/aws-sdk-js/commit/2d41be7eb7d984208aba050557d493694fcac3d1\"><code>2d41be7</code></a> Adding connectTimeout option in EC2MetadataCredentials class (<a href=\"https://github-redirect.dependabot.com/aws/aws-sdk-js/issues/3356\">#3356</a>)</li>\n<li><a href=\"https://github.com/aws/aws-sdk-js/commit/72f2e7372bc5e099eaf18e1b5d50456318894ab0\"><code>72f2e73</code></a> Updates SDK to v2.746.0</li>\n<li><a href=\"https://github.com/aws/aws-sdk-js/commit/bc370f5b051e1f11911d3aca6fdba4f450560c5c\"><code>bc370f5</code></a> Re-export ConfigBase to make client-generation backwards compatible (<a href=\"https://github-redirect.dependabot.com/aws/aws-sdk-js/issues/3434\">#3434</a>)</li>\n<li><a href=\"https://github.com/aws/aws-sdk-js/commit/fe8ea76f2975a09c87ab56c1888444debc139b89\"><code>fe8ea76</code></a> Updates SDK to v2.745.0</li>\n<li><a href=\"https://github.com/aws/aws-sdk-js/commit/f9642f5a6f2a6a381fd3b2627ffae1f76e2fbc96\"><code>f9642f5</code></a> Fix for array equality bug in the Node.js XML parser (<a href=\"https://github-redirect.dependabot.com/aws/aws-sdk-js/issues/3430\">#3430</a>)</li>\n<li><a href=\"https://github.com/aws/aws-sdk-js/commit/b3b33bfb93e40024116251a76be1bda299b45448\"><code>b3b33bf</code></a> Updates SDK to v2.744.0</li>\n<li>See full diff in <a href=\"https://github.com/aws/aws-sdk-js/compare/v2.743.0...v2.747.0\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://api.dependabot.com/badges/compatibility_score?dependency-name=aws-sdk&package-manager=npm_and_yarn&previous-version=2.743.0&new-version=2.747.0)](https://dependabot.com/compatibility-score/?dependency-name=aws-sdk&package-manager=npm_and_yarn&previous-version=2.743.0&new-version=2.747.0)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot use these labels` will set the current labels as the default for future PRs for this repo and language\n- `@dependabot use these reviewers` will set the current reviewers as the default for future PRs for this repo and language\n- `@dependabot use these assignees` will set the current assignees as the default for future PRs for this repo and language\n- `@dependabot use this milestone` will set the current milestone as the default for future PRs for this repo and language\n- `@dependabot badge me` will comment on this PR with code to add a \"Dependabot enabled\" badge to your readme\n\nAdditionally, you can set the following in your Dependabot [dashboard](https://app.dependabot.com):\n- Update frequency (including time of day and day of week)\n- Pull request limits (per update run and/or open at any time)\n- Automerge options (never/patch/minor, and dev/runtime dependencies)\n- Out-of-range updates (receive only lockfile updates, if desired)\n- Security updates (receive only security updates, if desired)\n\n\n\n</details>",
